import React from 'react';
import { Link } from 'react-router-dom';

function HeaderLinks() {
  return (
    <div className="dropdown">
      <button className="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenuButton" data-bs-toggle="dropdown" aria-expanded="false">
        Menu
      </button>
      <ul className="dropdown-menu" aria-labelledby="dropdownMenuButton">
        <li><Link to="/" className="dropdown-item">Home</Link></li>
        <li><Link to="/about" className="dropdown-item">About</Link></li>
        <li><Link to="/contact" className="dropdown-item">Contact</Link></li>
        <li><Link to="/signup" className="dropdown-item">Sign Up</Link></li>
      </ul>
    </div>
  );
}

export default HeaderLinks;
